import React from "react";

const FaceRecognition = ({ onInputChange, onSubmit }) => {
    return (
        <div className="flex flex-wrap justify-center mt3 shadow-3">
            <img src="https://samples.clarifai.com/face-det.jpg" alt="Detection Result"/>
        </div>
    )
}

export default FaceRecognition
